// React Native Tab - Example using React Navigation V5 //
// https://aboutreact.com/react-native-tab //
import 'react-native-gesture-handler';

import * as React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { createMaterialTopTabNavigator } from '@react-navigation/material-top-tabs';
//import MaterialCommunityIcons from 'react-native-vector-icons/MaterialCommunityIcons';
import {
    Alert,
    Modal,
    Text, View, StyleSheet, ScrollView, Button, TouchableOpacity, SafeAreaView, FlatList, Image,
    TouchableHighlight,
} from 'react-native';

import ServicePage from '../pages/ServicePage';
import AboutUsPage from '../pages/AboutUsPage';
import ReviewPage from '../pages/ReviewPage';

import DentalClinicServicesDetails from '../screens/DentalClinicServicesDetails';

const Stack = createStackNavigator();
const Tab = createMaterialTopTabNavigator();


function TabStack(modalVisible) {

    return (
        <NavigationContainer independent={true}>

            <TouchableOpacity style={{ width: 50, position: "absolute", right: 16, bottom: -8, zIndex: 1 }}
                onPress={() => {
                    //this.setModalVisible(true);
                }}
            >
                <Image style={{ width: 50 }}
                    resizeMode={'contain'}
                    source={require('../assets/filter.png')}
                />
            </TouchableOpacity>
            <Modal
                animationType="slide"
                transparent={true}
                //visible={modalVisible}
                visible={false}
                onRequestClose={() => {
                    Alert.alert("Modal has been closed.");
                }}
            >
                <View style={styles.centeredView}>
                    <View style={styles.modalView}>
                        <ScrollView>
                            <TouchableOpacity style={styles.modalText}>
                                <Text style={{ width: '50%', textAlign: 'left' }}>All Category</Text>
                                <Text style={{ width: '50%', textAlign: 'right' }}>45</Text>
                            </TouchableOpacity>
                            <TouchableOpacity style={styles.modalText}>
                                <Text style={{ width: '50%', textAlign: 'left' }}>All Category</Text>
                                <Text style={{ width: '50%', textAlign: 'right' }}>45</Text>
                            </TouchableOpacity>
                            <TouchableOpacity style={styles.modalText}>
                                <Text style={{ width: '50%', textAlign: 'left' }}>All Category</Text>
                                <Text style={{ width: '50%', textAlign: 'right' }}>45</Text>
                            </TouchableOpacity>
                            <TouchableOpacity style={styles.modalText}>
                                <Text style={{ width: '50%', textAlign: 'left' }}>All Category</Text>
                                <Text style={{ width: '50%', textAlign: 'right' }}>45</Text>
                            </TouchableOpacity>
                            <TouchableOpacity style={styles.modalText}>
                                <Text style={{ width: '50%', textAlign: 'left' }}>All Category</Text>
                                <Text style={{ width: '50%', textAlign: 'right' }}>45</Text>
                            </TouchableOpacity>
                        </ScrollView>
                        <TouchableHighlight
                            style={{ ...styles.openButton, backgroundColor: "#023859" }}
                            onPress={() => {
                                this.setModalVisible(!modalVisible);
                            }}
                        >
                            <Text style={styles.textStyle}>Hide Modal</Text>
                        </TouchableHighlight>
                    </View>
                </View>
            </Modal>
            <ScrollView>
                <View style={styles.containerImage}>
                    <Image
                        style={{
                            width: '100%',
                            height: 200,
                        }}
                        resizeMode={'cover'}
                        source={require('../assets/13.2-3-5-Car-Service-Profile/service_pic001.png')}
                    />

                    <View style={{
                        width: '100%',
                        flexDirection: 'row',
                        justifyContent: 'space-between',
                        marginTop: -30,
                    }}>
                        <Text style={{ color: '#FFFFFF', marginStart: 8 }}>10:00 AM - 6:00 MP</Text>
                        <View style={{ flexDirection: 'row', marginEnd: 8 }}>
                            <Text style={{ color: '#FFFFFF', fontSize: 12, borderRadius: 2, paddingStart: 4, paddingEnd: 4, backgroundColor: '#FF3B30' }}>Male</Text>
                            <Text style={{ color: '#FFFFFF', fontSize: 12, borderRadius: 2, paddingStart: 4, paddingEnd: 4, backgroundColor: '#8CC63F', marginStart: 4 }}>Female</Text>

                        </View>
                    </View>

                    <View style={{
                        width: '95%',
                        flexDirection: 'row',
                        marginTop: 16
                    }}>
                        <Image
                            style={{
                                width: 40, height: 40,
                                borderRadius: 4,
                                marginTop: 4
                            }}
                            resizeMode={'cover'}
                            source={require('../assets/13.1-4-6-More/vendor_logo.png')}
                        />
                        <View style={{ width: '90%', marginStart: 10 }}>
                            <Text style={{ fontSize: 18 }}>Car Wash Center</Text>
                            <View style={{ width: '94%', flexDirection: 'row', justifyContent: 'space-between' }}>
                                <Text style={{ fontSize: 16, color: '#999999' }}>Dubai- UAE</Text>
                                <View style={{flexDirection:'row', justifyContent:'center', alignItems:'center'}}>
                                    <Image style={{ width: 18, height: 18,}} source={require('../assets/13.2-3-5-Car-Service-Profile/star_sky.png')} />
                                    <Text style={{ fontSize: 16, fontWeight: 'bold', color: '#00C8E4' }}>4.5</Text>
                                </View>
                            </View>
                        </View>

                    </View>

                    <View style={{
                        width: "100%",
                        marginBottom: 16,
                        marginTop: 16,
